import React, { useState } from "react";
import Breadcrumbs from "../Breadcrumbs/Breadcrumbs";
import { getFirestore, collection, addDoc, serverTimestamp } from "firebase/firestore";
import app from "../../firebase"; // adjust if your path is different

const Contact = () => {
  const db = getFirestore(app);

  const [formData, setFormData] = useState({
    name: "",
    email: "",
    message: ""
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await addDoc(collection(db, "contacts"), {
        ...formData,
        createdAt: serverTimestamp()
      });
      alert("Message sent successfully!");
      setFormData({ name: "", email: "", message: "" }); // reset form
    } catch (error) {
      console.error("Error sending message:", error);
      alert("Failed to send message.");
    }
  };

  return (
    <div>
      <Breadcrumbs title="Contact us" />
      <div className="container py-16">
        <div className="pb-8">
          <h1 className="text-4xl font-bold font-Roboto">
            Drop a <span className="text-primary">Message</span>{" "}
          </h1>
          <p className="text-gray-400 py-2">
            Have a question or just want to say hi? We'd love to hear from you.
          </p>
        </div>
        <form onSubmit={handleSubmit} className="grid lg:grid-cols-2 grid-cols-1 lg:gap-6 gap-2 justify-between">
          <div>
            <fieldset>
              <label htmlFor="name">First name:</label>
              <input
                className="border-opacity-100 w-full border px-4 border-gray-800 py-2"
                type="text"
                id="name"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
              />
              <br /><br />
              <label htmlFor="email">Email:</label>
              <input
                className="border-opacity-100 w-full border px-4 border-gray-800 py-2"
                type="email"
                id="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
              />
              <br /><br />
              <label htmlFor="message">Message:</label>
              <textarea
                className="border-opacity-100 w-full border px-4 border-gray-800 py-2"
                rows="4"
                name="message"
                value={formData.message}
                onChange={handleChange}
                required
              />
              <br />
              <button type="submit" className="bg-white mt-4 border border-primary text-black py-3 px-6 rounded-md hover:bg-transparent hover:bg-primary hover:text-white transition">
                Submit
              </button>
            </fieldset>
          </div>

          {/* Right side - contact info */}
          <div className="inset-0 lg:px-16 px-8">
            <h1 className="text-4xl py-2 font-Poppins font-semibold">
              Get In <span className="text-primary"> Touch</span>
            </h1>
            <div className="flex py-4">
              <i className="fas fa-map-marker-alt text-3xl text-secondary"></i>
              <div className="px-8">
                <p>Chandigarh lil bro</p>
              </div>
            </div>
            <div className="flex py-4">
              <i className="far fa-envelope text-3xl text-secondary"></i>
              <div className="px-8">
                <p>info@adc.com</p>
                <p>support@adc.com</p>
              </div>
            </div>
            <div className="flex py-4">
              <i className="fas fa-phone text-3xl text-secondary"></i>
              <div className="px-8 font-bold">
                <p>+91 9191 123 567</p>
                <p>+91 5678 546 8975</p>
              </div>
            </div>
          </div>
        </form>

        <div className="relative z-0 mt-10">
          <iframe
            className="w-full h-96"
            title="map"
            src="https://www.google.com/maps/embed?...your-url..."
          ></iframe>
        </div>
      </div>
    </div>
  );
};

export default Contact;
